import React from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Layout from './components/common/Layout';
import Register from './components/auth/Register';
import GenerateInvoice from './components/admin/GenerateInvoice';
import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Layout>
          {/* Route for Register component */}
          <Route path="/register" component={Register} />

          {/* Route for GenerateInvoice component */}
          <Route path="/generate-invoice">
            <GenerateInvoice userId="user_id_here" /> {/* Pass user ID dynamically */}
          </Route>

          {/* Add more routes as needed */}
        </Layout>
      </div>
    </Router>
  );
}

export default App;
